import React from 'react';
import './Navbar.css';
import logo from '../assets/got7logo.png';
import { Routes, Route, NavLink } from "react-router-dom";

function Navbar() {
  return (
<>
    <style>
    {`
      html, body {
        background-image: linear-gradient(rgba(0, 0, 0, 0.527),rgba(0, 0, 0, 0.5)), url("https://pbs.twimg.com/media/FS958IEUYAEk2yT?format=jpg&name=4096x4096");
        /* background-size: cover; */
        background-size: 100vw 100vh;
        background-repeat: no-repeat;
        height: fit-content;

        .text{
          margin-top: 400px;
          /* margin-bottom: 190px; */
          color: white;
      }
      .text-kr {
          font-size: 18px;
          margin-bottom: -40px;
          text-align: center;
      }

      .text-en {
          font-size: 28px;
          text-align: center;
      }

      .home-button {
          margin-top: -20px;
          text-align: center;
      }

      .button {
          background-color: transparent;
          border-radius: 25px;
          border: 2px solid white;
          color: white;
          padding: 10px 20px;
          font-size: 16px;
          font-weight: semiBold;
          cursor: pointer;
        }          
    `}
  </style>
    <nav className="navbar">
      <div className="navbar-logo">
        <div className="pic"  style={{marginRight:'0'}}>
        <img className="logo7" src={logo} alt="Logo" />
        </div>
      </div>
      <div style={{justifyItems:'start'}}>
      <ul className="navbar-menu">
        <li className="navbar-item">
          <a href="/" className="navbar-link">HOME</a>
        </li>
        <li className="navbar-item">
          <a href="/discography" className="navbar-link">DISCOGRAPHY</a>
        </li>
        <li className="navbar-item">
          <a href="/notice" className="navbar-link">NOTICE</a>
        </li>
        <li className="navbar-item">
          <a href="/schedule" className="navbar-link">SCHEDULE</a>
        </li>
        <li className="navbar-item">
          <a href="/contact" className="navbar-link">CONTACT</a>
        </li>
        <li className="navbar-item">
          <a href="/about" className="navbar-link">ABOUT</a>
        </li>
      </ul>
      </div>
    </nav>
    </>
  );
}

export default Navbar;
